import './App.css';
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import Checkout from './Checkout';


function App() {
  <Router>
    <div className="App">
      <Switch>
      <Route path="/Checkout">
        <Header />
        <Checkout />
      </Route >
      <Route path="/">
        <Header />
        <Home />
      </Route >
      </Switch>
    </div>
  </Router>
}

export default App;
